import {takeEvery} from 'redux-saga/effects'
import { get } from './Reducer';

function* itemSaga(){
    let data = yield fetch('http://localhost:4000/items');
    data = yield data.json();
    const fetchTodo = (url) => fetch(url).then((res) => res.json());
}

export default itemSaga;
